def fitness_function(table):
    b_values = table[105:]
    a_values = table[:105]
    y1 = sum(b_values)  # First condition: Sum of b_i should be 1 for consistency

    # Calculate c values based on a_values
    c = [0] + [sum(a_values[i*(i-1)//2:i*(i-1)//2+i]) for i in range(1, len(b_values))]
    print(len(a_values))
    #c_2 = [0] + [sum(a_values[:i]) for i in range(1, len(a_values) + 1)]
    y2 = sum(b * c[i] for i, b in enumerate(b_values))  # Second order condition
    y3 = sum(b * c[i] ** 2 for i, b in enumerate(b_values))  # Third order condition
    y4 = sum(b_values[i] * sum(a_values[j] * c[j - i*(i-1)//2] for j in range(i*(i-1)//2, i*(i-1)//2 + i)) for i in range(1, len(b_values)))


    print(y1,y2,y3,y4)
    # Constraints
    constraint1 = abs(y1 - 1) <= 1e-50  # The sum of b values must be 1
    constraint2 = abs(y2 - 1 / 2) <= 1e-50  # Second order condition
    constraint3 = abs(y3 - 1 / 3) <= 1e-50  # Third order condition
    constraint4 = abs(y4 - 1 / 6) <= 1e-50  # Fourth order condition
    # Internal Stability Calculation
    #A = np.zeros((15, 15))  # Initialize A matrix as zeros
    #A[np.tril_indices(15, -1)] = a_values  # Fill lower triangular part of A with the provided coefficients
    #b_prime = np.array(b_values)
    #z = 1j  # Define z as imaginary unit
    #I = np.eye(15)
    #Q = z * np.dot(b_prime, np.linalg.inv(I - z * A))

    # Penalize deviations from desired internal stability criteria
    # For example, penalize large values of Q or maximize the minimum eigenvalue of (I - zA)^(-1)
    fitness_score =  0.0
    # Calculate fitness score based on constraints and internal stability
    if constraint1 and constraint2 and constraint3 and constraint4:
        fitness_score = 1.0  # Perfectly meets constraints

    A = np.zeros((15, 15))
    A[np.tril_indices(15, -1)] = a_values
    b_prime = np.array(b_values)
    z = 1j
    I = np.eye(15)

    # Ensure matrix inversion doesn't fail
    try:
        Q = z * np.dot(b_prime, np.linalg.inv(I - z * A))
        internal_stability = Q.real
    except np.linalg.LinAlgError:
        # If inversion fails, penalize heavily
        internal_stability = np.array([float('inf')])
    desired_stability_min = -70
    desired_stability_max = 0

    # Check if internal stability falls within the desired range
    stability_within_range = all(desired_stability_min <= val <= desired_stability_max for val in internal_stability)
    print(stability_within_range)
      #desired_stability_min = -70
    #desired_stability_max = 0

    # Penalize deviations from desired internal stability criteria
    stability_penalty = 0.1
    for val in internal_stability:
        if val < desired_stability_min:
            stability_penalty += desired_stability_min - val
        elif val > desired_stability_max:
            stability_penalty += val - desired_stability_max

    # Update fitness score based on stability penalty
    fitness_score -= stability_penalty

    return fitness_score



